class Plugin {

    private _logger: Logger = new Logger('DLT');
    private _connections: Map<string, IConnection> = new Map();

    constructor() {
        this._onIncomeRenderIPCMessage = this._onIncomeRenderIPCMessage.bind(this);
        PluginIPCService.subscribe(IPCMessages.PluginInternalMessage, this._onIncomeRenderIPCMessage);
    }

    private _onIncomeRenderIPCMessage(message: IPCMessages.PluginInternalMessage, response: (res: IPCMessages.TMessage) => any) {
        // Process commands
        switch (message.data.command) {
            case 'connect':
                return this._income_connect(message).then(() => {
                    response(new IPCMessages.PluginInternalMessage({
                        data: {
                            status: 'connecting',
                            stream: message.stream
                        },
                        token: message.token,
                        stream: message.stream
                    }));
                }).catch((error: Error) => {
                    return response(new IPCMessages.PluginError({
                        message: error.message,
                        stream: message.stream,
                        token: message.token,
                        data: {
                            command: message.data.command,
                            stream: message.stream
                        }
                    }));
                });
            case 'disconnect': 
                return this._income_disconnect(message).then(() => {
                    response(new IPCMessages.PluginInternalMessage({
                        data: {
                            status: 'disconnected',
                            stream: message.stream
                        },
                        token: message.token,
                        stream: message.stream
                    }));
                }).catch((error: Error) => {
                    return response(new IPCMessages.PluginError({
                        message: error.message,
                        stream: message.stream,
                        token: message.token,
                        data: {
                            command: message.data.command,
                            stream: message.stream
                        }
                    }));
                });
            default:
                this._logger.warn(`Unknown commad: ${message.data.event}`);
        }
    }

    private _income_connect(message: IPCMessages.PluginInternalMessage): Promise<void> {
        return new Promise((resolve, reject) => {
            const streamId: string | undefined = message.stream;
            if (streamId === undefined) {
                return reject(new Error(`Cannot make connection because reference to stream (stream ID) isn't defiend.`));
            }
            if (this._connections.has(streamId)) {
                return reject(new Error(`Cannot make connection because stream "${streamId}" is already has connection. Close connection before to reconnect.`));
            }
            if (typeof message.data.ip !== 'string') {
                return reject(new Error(`Cannot make connection for stream "${streamId}" because IP of demon isn't defined.`));
            }
            if (typeof message.data.port !== 'number') {
                return reject(new Error(`Cannot make connection for stream "${streamId}" because port of demon isn't defined.`));
            }
            // Notify client about starting connection
            PluginIPCService.sendToPluginHost(message.stream, {
                event: 'connecting',
                stream: streamId,
            });    
            // Create connection
            setTimeout(() => {
                this._socket_onConnected(streamId, new Net.Socket());
                
            }, Math.random() * 2000);
            /*
            const socket: Net.Socket = Net.connect(message.data.port, message.data.host, this._socket_onConnected.bind(this, streamId, socket));
            socket.on('close', this._socket_onClose.bind(this, streamId));
            socket.on('error', this._socket_onError.bind(this, streamId));
            socket.on('data', this._socket_onData.bind(this, streamId));
            */
        });
    }

    private _emulate(streamId: string) {
        const connection: IConnection | undefined = this._connections.get(streamId);
        if (connection === undefined) {
            // Already closed
            return;
        }
        const index = Math.round(Math.random() * 10);
        const chunk = Buffer.from(messages[index]);
        connection.buffer.add(chunk);
        setTimeout(this._emulate.bind(this, streamId), Math.random() * 150);
    }

    private _socket_onConnected(streamId: string, socket: Net.Socket) {
        // Create buffer
        const buffer: DLT.Buffer = new DLT.Buffer();
        buffer.on(DLT.Buffer.Events.packet, this._buffer_onPacket.bind(this, streamId));
        // Store connection
        this._connections.set(streamId, {
            socket: socket,
            buffer: buffer,
            bytes: 0,
            packets: 0,
        });
        // Start emulation
        this._emulate(streamId);
        // Notify client
        PluginIPCService.sendToPluginHost(streamId, {
            event: 'connected',
            stream: streamId,
        });
    }

    private _socket_onClose(streamId: string) {
        this._destroyConnection(streamId);
    }

    private _socket_onError(streamId: string, error: Error) {
        PluginIPCService.sendToPluginHost(streamId, {
            event: 'error',
            stream: streamId,
            error: error.message
        });
        this._destroyConnection(streamId);
    }

    private _socket_onData(streamId: string, chunk: Buffer) {
        const connection: IConnection | undefined = this._connections.get(streamId);
        if (connection === undefined) {
            // Already closed
            return;
        }
        connection.buffer.add(chunk);
    }

    private _buffer_onPacket(streamId: string, packet: DLT.IPacketData) {
        const connection: IConnection | undefined = this._connections.get(streamId);
        if (connection === undefined) {
            // Already closed
            return;
        }
        const chunk: Buffer = Buffer.from(JSON.stringify(packet) + '\n');
        connection.bytes += packet.length;
        connection.packets += 1;
        PluginIPCService.sendToStream(chunk, streamId).then(() => {
            // Send statistic information to plugin host
            PluginIPCService.sendToPluginHost(streamId, {
                event: 'stat',
                stream: streamId,
                bytes: connection.bytes,
                packets: connection.packets,
            });
        });
    }

    private _destroyConnection(streamId: string) {
        const connection: IConnection | undefined = this._connections.get(streamId);
        if (connection === undefined) {
            // Already closed
            return;
        }
        PluginIPCService.sendToPluginHost(streamId, {
            event: 'disconnected',
            stream: streamId,
        });
        connection.socket.destroy();
        connection.buffer.destroy();
        this._connections.delete(streamId);
    }

    private _income_disconnect(message: IPCMessages.PluginInternalMessage): Promise<void> {
        return new Promise((resolve, reject) => {
            const streamId: string | undefined = message.stream;
            if (streamId === undefined) {
                return reject(new Error(`Cannot destroy connection because reference to stream (stream ID) isn't defiend.`));
            }
            const connection: IConnection | undefined = this._connections.get(streamId);
            if (connection === undefined) {
                // Already closed
                return reject(new Error(`Connection for stream "${streamId}" is already closed.`));
            }
            this._destroyConnection(streamId);
            resolve();           
        });
    }

}

const app: Plugin = new Plugin();
